import Link from "next/link";
import fetch from "isomorphic-unfetch";

const Robots = () => {
  return (
    <div>
      <h1>Robots</h1>
      <div>Robots data</div>
      <Link href="/">
        <button>Home</button>
      </Link>
    </div>
  );
};

export default Robots;
